import {ACCESS_TOKEN_WAS_NOT_VALID} from '../actions/tokenManagement';
function token(state,action) {
    switch (action.type) {
        case ACCESS_TOKEN_WAS_NOT_VALID:
            return {}
        default:
            return state;
    }
}
export default token;
